import axios from "axios";
import { Card, Button } from "react-bootstrap";
import '../styles/Card.css'

class TripList extends Component{
    
    
    constructor(props) {
        super(props)
        this.state = { 
             products : []
        }
    }    
    
    
    // componentDidMount() { 
